Don’t get me wrong: I’m impressed with what ChatGPT can do! I’m just not in love with how long it takes to learn how to use it effectively. The possibilities are endless, but that’s part of the problem (for busy people).

Right now, I still favor other generative AI platforms built for SPECIFIC uses—like copywriting, art, code, etc.

Today’s post (and my latest video) explores some of those platforms I recommend right now, including:

@Anyword.ai (copywriting)
Bard by Google (debugging code)
TruthGPT (AI without bias)
@chatsonicai (research)
@Adobe Firefly (art/visuals)

For a more detailed look at each, check this week’s video—link in bio 🔗

How deep are you into generative AI tools? How has your experience been so far? ⬇️

Here's why I love creating content: The more you post, the more you learn. The more you learn, the more you grow—not just in followers, but in learning opportunities, confidence, and business.

For example, content creation allows me to research and learn about a topic (before sharing it with you), which I wouldn't otherwise take the time to do.
